import '../styles/App.css';
import Registration from '../pages/signup';
import Authentification from '../pages/signin';

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";


function App() {
  return (
    <Router>
      <Switch>
        <Route path="/signin">
            <Authentification />
        </Route>
        <Route path="/">
            <Registration />
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
